import React from "react";
import Button from "./loginbutton";
import fire from "./fire";


function LoginScreen() {
 const [email, setemail] = useState(initialState);
 const [password, setpassword] = useState(initialState);
  return (
    <div className="container-fluid login-back">
      <div class="row">
        <div class="col-lg-">
          <div class="logcard1">
            <div class="button-position">
              <Button />
            </div>
            <div className="login-text">WELCOME BACK!</div>
            <div className="form-div">
	<div class="modal-dialog modal-login">
		<div class="modal-content">
			<div class="modal-header">				
				<h4 class="modal-title">LOGIN WITH EMAIL</h4>
			</div>
			<div class="modal-body">
				<form action="/examples/actions/confirmation.php" method="post">
					<div class="form-group">
						<input type="text" class="form-control" placeholder="Email" required="required"/>
					</div>
					<div class="form-group">
						<input type="password" class="form-control" placeholder="Password" required="required"/>
					</div>
					<div class="form-group">
						<input onClick = {(e) => {
                            e.preventDefault();
                            fire.auth().signInWithEmailAndPassword(email, password).then((u)=>{
                            }).catch((error) => {
                                console.log(error);
                              });

                        }} type="submit" class="btn btn-primary btn-block btn-lg" value="Sign in"/>
					</div>
				</form>				
				<p class="hint-text small"><a href="#">Forgot Your Password?</a></p>
                
			</div>
		</div>
	
</div>     










            </div>
          </div>
        </div>
        <div class="col-lg-">
          <div class="logcard2">
            <div class="signup-text">
              <p>SIGN UP</p>
              <p>WITH</p>
              <p>KHANA SHANA</p>
            </div>
            <div class="card2-img">
              <img src="./images/Group 10580.svg" alt="" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default LoginScreen;
